import logo from '../../logo.svg';
import NavBar from '../navbar/NavBar';

function Header() {
    const logotipo = <img src={logo} width="70px" />;

    return (
        <div className="row m-3">
            <div className="col"> 
                <h1 className="fs-1 fw-bold mytitle">{logotipo} MyBook</h1>
            </div>
            <div className="col">
                <NavBar />
            </div>
        </div>
    );
}
export default Header;
